import React from 'react';

function Footer() {
    return (
        <div>
            <div style={{ backgroundColor: "#343a40" }} className="card text-center card-dark">

                <div className="card-body">
                    <h5 style={{ color: "white" }}>Suresh Mangs</h5>
                    <p style={{ color: "white" }}>using React and Redux integrated with external movies data API
                    <a href="http://www.omdbapi.com/"> OMDB</a></p>

                </div>

            </div>
        </div >
    )
}

export default Footer
